import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import './ViewWaypointsPage.css';

interface Waypoint {
  _id: string;
  lat: number;
  lng: number;
  title: string;
  description: string;
  image?: string;
  images?: string[];
}

const ViewWaypointsPage = () => {
  const [waypoints, setWaypoints] = useState<Waypoint[]>([]);

  useEffect(() => {
    fetch('http://localhost:3001/api/waypoints')
      .then(res => res.json())
      .then(data => setWaypoints(data))
      .catch(err => console.error('Error fetching waypoints:', err));
  }, []);

  return (
    <div className="waypoints-container">
      <h1>All Waypoints</h1>
      <div className="waypoints-grid">
        {waypoints.map(wp => (
          <div className="waypoint-card" key={wp._id}>
            <h2>{wp.title}</h2>
            <p><strong>Description:</strong> {wp.description}</p>
            <p><strong>Latitude:</strong> {wp.lat}</p>
            <p><strong>Longitude:</strong> {wp.lng}</p>
            {wp.image && (
              <img
                className="waypoint-image"
                src={`http://localhost:3001${wp.image}`}
                alt={wp.title}
              />
            )}
            <Link to={`/journal/${wp._id}`} className="view-journal-button">
              View Journal
            </Link>
          </div>
        ))}
      </div>
    </div>
  );
};

export default ViewWaypointsPage;
